import React from "react";
import "./Navbar.css";
const Navbar = () => {
  return (
    <div className="navBar">
      <span>Algorithms</span>
      <span>Speed</span>
      <span>
        <div className="visitedNode"></div>
        Visited Nodes
      </span>
      <span>
        <div className="unvisitedNode"> </div>
        Unvisited Nodes
      </span>
      <span>
        <div className="path"></div>
        Path
      </span>
    </div>
  );
};
export default Navbar;
